import React from "react";

const Navbar = () => {
    return (
        <nav className="navbar navbar-dark bg-dark mb-4">
            <span className="navbar-brand mb-3 mx-auto">
                <h1><strong>E-Commerce</strong></h1>
                <button className="btn btn-light float-left">Create item</button>
                <Link className="btn btn-light float-right"><i className="fas fa-shopping-cart"></i></Link>
            </span>
        </nav>
    );
};

export default Navbar;
